import './App.css';
import { BrowserRouter as Router, Routes, 
  Route} from "react-router-dom";
import Navbar from './components/Navbar';
function App() {
  return (
    <>
      <div className="App">
        <Route path="/campaign">
          <Navbar/>
        </Route>;
      </div>
    </>
  );
}

export default App;
